import React from 'react'

class GalleryItem extends React.Component {
    constructor(props) {
        super(props);
    }
    componentDidMount() {
        this.state = {
            element: this.props.element
        }
        this.state.element.key = 1
    }
    render() {
        return (
            this.props.element
        )
    }
}

export default GalleryItem;
